'use strict';(function(){const b={cache:!0};b.doc={id:'id',field:['title','content'],store:['title','href','section']};const a=FlexSearch.create('balance',b);window.bookSearchIndex=a,a.add({id:0,href:'/documentation/docs/10-getting-started/',title:"Getting started",section:"Docs",content:"Getting started #  Getting started as Quiqr User or developer\u0026hellip;\n"}),a.add({id:1,href:'/documentation/docs/10-getting-started/01.installation/',title:"Install Quiqr Desktop",section:"Getting started",content:"Install Quiqr #  Download the latest version of Quiqr for your operating system.\nmacOS #   Quiqr for Mac\nWindows #   Quiqr for Windows\nAfter download execute the .exe-file to install Quiqr.\nLinux #   Quiqr for Linux AppImage\n Quiqr for Linux Deb\n Quiqr for Linux RPM\nYou can also find the Quiqr App in the Snapcraft Store.\n"}),a.add({id:2,href:'/documentation/docs/10-getting-started/02.import-quiqr-hugo-site/',title:"Import Quiqr Hugo template",section:"Getting started",content:"todo\n"}),a.add({id:3,href:'/documentation/docs/99-about-this-book/',title:"About this book",section:"Docs",content:"About SVG Stencils Documentation #  To search for a particular term within the documentation, select the \u0026lsquo;magnifying glass\u0026rsquo; icon, or press \u0026rsquo;s'.\nThe latest version of this documentation is located at https://svg-stencils.github.io/documentation/.\nExample Commands #  Examples in this guide may have snippets of commands to be run in your shell or paste in your editor. When you see a snippet beginning with $ it\u0026rsquo;s a shell command. as your normal user. After either of these lines, there may be example output from the command.\nPlaceholders #  Some examples include text with placeholders. Placeholders indicate where you should substitute the appropriate information. For example:\n$ cat ~/Quiqr Data/config.\u0026lt;site_name\u0026gt;.json This means you need to substitute the text \u0026lt;site_name\u0026gt; with the actual site name.\nContributing #  We welcome contributions to this book. Please read our Contributing Guidelines.\n"})})()